--
-- Table structure for table `fattura`
--

DROP TABLE IF EXISTS `fattura`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `fattura` (
  `NumeroFat` int NOT NULL,
  `DenomLavoro` varchar(50) NOT NULL,
  `TipoLavoro` varchar(25) NOT NULL,
  `PartitaIVA` char(11) NOT NULL,
  `CF` char(16) NOT NULL,
  `Tipo` char(3) NOT NULL,
  `Tipologia` varchar(50) NOT NULL,
  `Modalita` varchar(30) NOT NULL,
  `Imponibile` int NOT NULL,
  `CostiEsentiIVA` int NOT NULL,
  `RitenutaAcc` int NOT NULL,
  `RitenutaRistr` int NOT NULL,
  `DataFaT` date DEFAULT NULL,
  `DataPreFat` date DEFAULT NULL,
  `DataInc` date DEFAULT NULL,
  PRIMARY KEY (`NumeroFat`,`DenomLavoro`,`TipoLavoro`,`PartitaIVA`,`CF`),
  KEY `DenomLavoro` (`DenomLavoro`,`TipoLavoro`),
  KEY `PartitaIVA` (`PartitaIVA`,`CF`,`Tipo`),
  CONSTRAINT `fattura_ibfk_1` FOREIGN KEY (`DenomLavoro`, `TipoLavoro`) REFERENCES `lavoro` (`Denominazione`, `Tipo`),
  CONSTRAINT `fattura_ibfk_2` FOREIGN KEY (`PartitaIVA`, `CF`, `Tipo`) REFERENCES `cliente` (`PartitaIVA`, `CF`, `Tipo`),
  CONSTRAINT `CheckDataInc` CHECK ((`DataInc` > `DataFat`)),
  CONSTRAINT `CheckDataPre` CHECK (((`DataPreFat` is null) or (`DataFat` is null) or (`DataPreFat` <= `DataFat`))),
  CONSTRAINT `fattura_chk_1` CHECK ((`Imponibile` >= 0)),
  CONSTRAINT `fattura_chk_2` CHECK ((`CostiEsentiIVA` >= 0)),
  CONSTRAINT `fattura_chk_3` CHECK ((`RitenutaAcc` >= 0)),
  CONSTRAINT `fattura_chk_4` CHECK ((`RitenutaRistr` >= 0))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

