DROP TABLE IF EXISTS `lavoro`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lavoro` (
  `Denominazione` varchar(50) NOT NULL,
  `Tipo` varchar(25) NOT NULL,
  `Descrizione` varchar(5000) DEFAULT NULL,
  `DataInizio` date NOT NULL,
  `DataConclusione` date DEFAULT NULL,
  `Supervisore` char(16) NOT NULL,
  `TotFat` decimal(10,2) DEFAULT '0.00',
  `TotInc` decimal(10,2) DEFAULT '0.00',
  `ValoreStim` decimal(10,2) DEFAULT NULL,
  `Scadenza` date DEFAULT NULL,
  PRIMARY KEY (`Denominazione`,`Tipo`),
  KEY `Supervisore` (`Supervisore`),
  CONSTRAINT `lavoro_ibfk_1` FOREIGN KEY (`Supervisore`) REFERENCES `tecnico` (`CF`),
  CONSTRAINT `checkDataConcl` CHECK (((`DataConclusione` > `DataInizio`) or (`DataConclusione` is null))),
  CONSTRAINT `checkVal` CHECK ((((`ValoreStim` is not null) and (`Tipo` like _utf8mb4'PER%')) or (`ValoreStim` is null)))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
