--
-- Table structure for table `progetto`
--

DROP TABLE IF EXISTS `progetto`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `progetto` (
  `PRDenominazione` varchar(50) NOT NULL,
  `PRTipo` varchar(25) NOT NULL,
  `InizioAccessi` date DEFAULT NULL,
  `FineAccessi` date DEFAULT NULL,
  `InizioSopralluoghi` date DEFAULT NULL,
  `FineSopralluoghi` date DEFAULT NULL,
  `InizioComputo` date DEFAULT NULL,
  `FineComputo` date DEFAULT NULL,
  `IncFirmato` tinyint(1) DEFAULT '0',
  `IncInviato` tinyint(1) DEFAULT '0',
  `DirLavori` tinyint(1) DEFAULT '0',
  `Direttore` char(16) DEFAULT NULL,
  `InizioLavori` date DEFAULT NULL,
  `FineLavori` date DEFAULT NULL,
  PRIMARY KEY (`PRDenominazione`,`PRTipo`),
  CONSTRAINT `progetto_ibfk_1` FOREIGN KEY (`PRDenominazione`, `PRTipo`) REFERENCES `lavoro` (`Denominazione`, `Tipo`),
  CONSTRAINT `checkDir` CHECK (((`Direttore` is null) or ((`Direttore` is not null) and (`DirLavori` = true)))),
  CONSTRAINT `checkFineAccessi` CHECK (((`FineAccessi` is null) or ((`FineAccessi` is not null) and (`FineAccessi` > `InizioAccessi`)))),
  CONSTRAINT `checkFineComp` CHECK (((`FineComputo` is null) or ((`FineComputo` is not null) and (`FineComputo` > `InizioComputo`)))),
  CONSTRAINT `checkFineLav` CHECK (((`FineLavori` is null) or ((`FineLavori` is not null) and (`FineLavori` > `InizioLavori`)))),
  CONSTRAINT `checkFineSopr` CHECK (((`FineSopralluoghi` is null) or ((`FineSopralluoghi` is not null) and (`FineSopralluoghi` > `InizioSopralluoghi`)))),
  CONSTRAINT `checkIncFirm` CHECK ((((0 <> `IncFirmato`) is false) or (((0 <> `IncFirmato`) is not false) and (`IncInviato` = true)))),
  CONSTRAINT `progetto_chk_1` CHECK ((`PRTipo` like _utf8mb4'PRO%'))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

