DROP TABLE IF EXISTS `proprieta`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `proprieta` (
  `PartitaIVA` char(11) NOT NULL,
  `CF` char(16) NOT NULL,
  `Tipo` char(3) NOT NULL,
  `CAP` char(5) NOT NULL,
  `Indirizzo` varchar(70) NOT NULL,
  `NumCiv` varchar(6) NOT NULL,
  `DataInizioProp` date NOT NULL,
  `DataFineProp` date DEFAULT NULL,
  PRIMARY KEY (`PartitaIVA`,`CF`,`Tipo`,`CAP`,`Indirizzo`,`NumCiv`),
  KEY `CAP` (`CAP`,`Indirizzo`,`NumCiv`),
  CONSTRAINT `proprieta_ibfk_1` FOREIGN KEY (`PartitaIVA`, `CF`, `Tipo`) REFERENCES `cliente` (`PartitaIVA`, `CF`, `Tipo`),
  CONSTRAINT `proprieta_ibfk_2` FOREIGN KEY (`CAP`, `Indirizzo`, `NumCiv`) REFERENCES `struttura` (`CAP`, `Indirizzo`, `NumCiv`),
  CONSTRAINT `CheckDate` CHECK ((((`DataInizioProp` is null) and (`DataFineProp` is null)) or ((`DataInizioProp` is not null) and (`DataFineProp` is not null)) or ((`DataInizioProp` is not null) and (`DataFineProp` is null)))),
  CONSTRAINT `proprieta_chk_1` CHECK ((`DataInizioProp` < `DataFineProp`))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

