DROP TABLE IF EXISTS `struttura`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `struttura` (
  `CAP` varchar(5) NOT NULL,
  `Indirizzo` varchar(70) NOT NULL,
  `NumCiv` varchar(6) NOT NULL,
  `Provincia` varchar(30) NOT NULL,
  `Citta` varchar(30) NOT NULL,
  `Comune` varchar(50) NOT NULL,
  `DataCostruzione` date DEFAULT NULL,
  `ComuneCatastale` varchar(50) DEFAULT NULL,
  `Foglio` int DEFAULT NULL,
  `Particella` int DEFAULT NULL,
  `Subalterno` int DEFAULT NULL,
  `Scala` int DEFAULT NULL,
  `Piano` int DEFAULT NULL,
  `Sezione` int DEFAULT NULL,
  `Tipo` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`CAP`,`Indirizzo`,`NumCiv`),
  CONSTRAINT `struttura_chk_1` CHECK (((`Foglio` = NULL) or (`Foglio` >= 0))),
  CONSTRAINT `struttura_chk_2` CHECK (((`Particella` = NULL) or (`Particella` >= 0))),
  CONSTRAINT `struttura_chk_3` CHECK (((`Subalterno` = NULL) or (`Subalterno` >= 0))),
  CONSTRAINT `struttura_chk_4` CHECK (((`Scala` = NULL) or (`Scala` >= 0))),
  CONSTRAINT `struttura_chk_5` CHECK (((`Piano` = NULL) or (`Piano` >= 0))),
  CONSTRAINT `struttura_chk_6` CHECK (((`Sezione` = NULL) or (`Sezione` >= 0)))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

